import React, { Component } from "react";
import { connect } from "react-redux";
import {fetchMovie} from '../actions'

class MovieDetails extends Component {
    componentDidMount(){
        this.props.fetchMovie(this.props.match.params.id);
    }
    render() {
        const {title, poster_path, backdrop_path, overview} = this.props.movies
        return (
            <div>
                <h5 className="search_result_card_title">{title}</h5>
                <img
                className="search_image img-fluid"
                src={`https://image.tmdb.org/t/p/w500${poster_path}`}
                alt=""
                />
                <img
                className="search_image img-fluid"
                src={`https://image.tmdb.org/t/p/w500${backdrop_path}`}
                alt=""
                />
                {overview}
                <Card body>
                    <CardTitle>Special Title Treatment</CardTitle>
                    <CardText>With supporting text below as a natural lead-in to additional content.</CardText>
                    <Button>Go somewhere</Button>
                </Card>
            </div>
        );
    };
}
const mapStateToProps = state => ({
  movies: state.trending.movieDetails
});
export default connect(mapStateToProps, { fetchMovie})(MovieDetails);
